import React from "react";
class Test extends React.Component {
    constructor() {
        super();
        this.state = {
            message: "Hello!"
        };
        this.updateMessage = this.updateMessage.bind(this);
    }

    updateMessage() {
            if(this.state.message === "my friend Taras!") {
        this.setState({
            message: "my friend Misha!"
        });
    } else {
        this.setState({
            message: "my friend Taras!"
        });
    }
    }

    render() {
        return (
            <div>
                <h1>Hello {this.state.message}!</h1>
                <button className="red-button-accept" onClick={this.updateMessage}>Click me!</button>
            </div>
        );
    }
}

export default Test;
